import Styles from '../../Styles/TimelineView'



import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Timeline from '@material-ui/lab/Timeline';
import TimelineItem from '@material-ui/lab/TimelineItem';
import TimelineSeparator from '@material-ui/lab/TimelineSeparator';
import TimelineConnector from '@material-ui/lab/TimelineConnector';
import TimelineContent from '@material-ui/lab/TimelineContent';
import TimelineOppositeContent from '@material-ui/lab/TimelineOppositeContent';
import TimelineDot from '@material-ui/lab/TimelineDot';
import FastfoodIcon from '@material-ui/icons/Fastfood';
import LaptopMacIcon from '@material-ui/icons/LaptopMac';
import HotelIcon from '@material-ui/icons/Hotel';
import RepeatIcon from '@material-ui/icons/Repeat';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles((theme) => ({
  paper: {
    padding: '6px 16px',
  },
  secondaryTail: {
    backgroundColor: theme.palette.secondary.main,
  },
}));


export default class TimelineView extends React.Component {

    render() {
        const { data, lng, lngTranslations } = this.props;
        const Translations = lngTranslations[this.constructor.name];
        // const Inner = data.data.map((sTimeline, idx) => {
        //     return (
        //         <TimelineItem
        //             key={idx}
        //         >
        //             <MyTimelineOppositeContent
        //                 txt={sTimeline.date.replace(/{_UNTIL_NOW_YEAR_TRANS_}/g, Moment(new Date()).format('Y'))}
        //             />
        //             <MyTimelineSeparator />
        //             <MyTimelineContent
        //                 txt={sTimeline.content[lng]}
        //             />
        //         </TimelineItem>
        //     )
        // });
        return(
            <Grid
                container
                justify="center"
                style={Styles.mainRow}
            >
                <Grid
                    item
                    xs={12}
                    sm={12}
                    md={12}
                    lg={12}
                >
                    <Card
                        bg="light"
                        key="1"
                        text="dark"
                    >
                        <Card.Header style={Styles.cardHeader}>
                            {Translations[data.title]}
                        </Card.Header>
                        <Card.Body style={Styles.cardBody}>


                        <Timeline align="alternate">
                          <TimelineItem>
                            <TimelineOppositeContent>
                              <Typography variant="body2" color="textSecondary">
                                9:30 am
                              </Typography>
                            </TimelineOppositeContent>
                            <TimelineSeparator>
                              <TimelineDot>
                                <FastfoodIcon />
                              </TimelineDot>
                              <TimelineConnector />
                            </TimelineSeparator>
                            <TimelineContent>
                              <Paper elevation={3} style={Styles.timelineContentPaper}>
                                <Typography variant="h6" component="h1">
                                  Eat
                                </Typography>
                                <Typography>Because you need strength</Typography>
                              </Paper>
                            </TimelineContent>
                          </TimelineItem>
                          <TimelineItem>
                            <TimelineOppositeContent>
                              <Typography variant="body2" color="textSecondary">
                                10:00 am
                              </Typography>
                            </TimelineOppositeContent>
                            <TimelineSeparator>
                              <TimelineDot color="primary">
                                <LaptopMacIcon />
                              </TimelineDot>
                              <TimelineConnector />
                            </TimelineSeparator>
                            <TimelineContent>
                              <Paper elevation={3} style={Styles.timelineContentPaper}>
                                <Typography variant="h6" component="h1">
                                  Code
                                </Typography>
                                <Typography>Because it&apos;s awesome!</Typography>
                              </Paper>
                            </TimelineContent>
                          </TimelineItem>
                        </Timeline>



                        </Card.Body>
                    </Card>
                </Grid>
            </Grid>
        )
    }

}

